CREATE TABLE familia(
    familia_id INTEGER PRIMARY KEY AUTOINCREMENT,
    familia_nome VARCHAR(50) NOT NULL,
    familia_link VARCHAR(255) NOT NULL
);

    
CREATE TABLE especie(
    especie_id INTEGER PRIMARY KEY AUTOINCREMENT,
    especie_nome_popular VARCHAR(50) NOT NULL,
    especie_nome_cientifico VARCHAR(255) NOT NULL,
    familia_fk INT NOT NULL,
    FOREIGN KEY (familia_fk) REFERENCES familia(familia_id)
);


-- SQLite não aceita o tipo ENUM, em substituição, temos de usar  uma restrição do tipo TEXT CHECK
    
CREATE TABLE dispositivo_legal(
    dispositivo_legal_id INTEGER PRIMARY KEY AUTOINCREMENT,
    dispositivo_legal_tipo TEXT CHECK(dispositivo_legal_tipo IN ('Lei', 'Decreto')),
    dispositivo_legal_numero INT NOT NULL,
    dispositivo_legal_ano INT NOT NULL
);


--RPA - Região Politico-Adminstrativa da Cidade, para formação em mapa
    
CREATE TABLE rpa(
    rpa_id INTEGER PRIMARY KEY AUTOINCREMENT,
    rpa_nome VARCHAR(255) NOT NULL,
    rpa_geometry VARCHAR(255) NOT NULL,
    rpa_coordinates TEXT NOT NULL
);


CREATE TABLE arvore(
    arvore_id INTEGER PRIMARY KEY AUTOINCREMENT,
    arvore_familia_fk INT NOT NULL,
    arvore_especie_fk INT NOT NULL,
    arvore_W_coord INT NOT NULL,
    arvore_N_coord INT NOT NULL,
    arvore_latitude REAL NOT NULL,
    arvore_longitude REAL NOT NULL,
    arvore_endereco TEXT NOT NULL,
    arvore_ponto_referencia TEXT,
    arvore_observacoes TEXT,
    arvore_rpa_fk INT NOT NULL,
    arvore_dispositivo_legal_fk INT NOT NULL
);


ALTER TABLE arvore ADD FOREIGN KEY (arvore_familia_fk) REFERENCES familia(familia_id);
ALTER TABLE arvore ADD FOREIGN KEY (arvore_especie_fk) REFERENCES especie(especie_id);
ALTER TABLE arvore ADD FOREIGN KEY (arvore_rpa_fk) REFERENCES rpa(rpa_id);
ALTER TABLE arvore ADD FOREIGN KEY (arvore_dispositivo_legal_fk) REFERENCES dispositivo_legal(dispositivo_legal_id);

CREATE TABLE Manutencao (
    manutencao_id INTEGER PRIMARY KEY,
    arvore_id INTEGER,
    manutencao_tipo TEXT CHECK(manutencao_tipo IN ('Poda', 'Desparasitização', 'Cosmética')),
    data_manutencao DATE,
    descricao TEXT,
    FOREIGN KEY (arvore_id) REFERENCES arvore(id_arvore)
);

